import React from 'react';
import { Box, Grid, VStack, Heading, Text, Button, Code } from '@chakra-ui/react';
import { useNavigate } from 'react-router-dom';

const Portfolio = () => {
  const navigate = useNavigate;
  return (
    <Box textAlign="center" fontSize="xl">
      <Grid minH="100vh" p={3}>
        <VStack spacing={8}>
          <Heading>Param's Portfolio</Heading>
          <Text>
            Edit <Code fontSize="xl">src/App.js</Code> and save to reload.
          </Text>
          <Button onClick={navigate('/blogs')}>Learn through blogs</Button>
          <Button onClick={navigate('/blogs/blog/mongoDB')}>mongo</Button>
          <Button onClick={navigate('/achivements')}>achivements</Button>
          <Button onClick={navigate('/works')}>works</Button>
        </VStack>
      </Grid>
    </Box>
  );
};

export default Portfolio;
